          body {
            overflow: hidden;
          }

          #invisible {
            display: none;
            color: transparent;
          }

          /* Styles specific to this particular page */

          /* Force the scroll bar to the left hand side of the screen */
          .jspVerticalBar {
            left: 0;
          }


          .scroll-pane {
            width: 90%;

            overflow: auto;
          }

          html,
          body {
            height: 100%;
            margin: 0;
            padding: 0;
          }

          html>body {
            font-size: 16px;
            font-size: 68.75%;
          }

          /* Reset Base Font Size */

          body {
            font-family: Verdana, helvetica, arial, sans-serif;
            font-size: 80.75%;
            background: #ffffff;
            color: blue;

            background-image: #dc143c;
            background-image: -moz-linear-gradient(top,
                #DC143C; 0%,
                #000000 44%,
                #FF7F50; 100%;
            background-image: -webkit-gradient(linear,
                left top,
                left bottom,
                color-stop(0%, #DC143C; ),
                color-stop(44%, #000000),
                color-stop(100%, #FF7F50; ));
            background-image: -webkit-linear-gradient(top,
                #DC143C; 0%,
                #000000 44%,
                #FF7F50; 100%);
            background-image: -o-linear-gradient(top,
                #DC143C; 0%,
                #000000 44%,
                #FF7F50; 100%);
            background-image: -ms-linear-gradient(top,
                #DC143C; 0%,
                #000000 44%,
                #FF7F50; 100%);
            filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#c9de96', endColorstr='#000000', GradientType=0);
            background-image: linear-gradient(top,
                #DC143C; 0%,
                #000000 44%,
                #FF7F50; 100%);

            display: flex;
            flex-direction: row;
          }

          h1 {
            font-family: "trebuchet ms", verdana, arial;
            padding: 10px;
            padding-top: 12px;
            padding-bottom: 0px;
            margin: 0;
          }

          a img {
            border: none;
          }

          .loading {
            background: rgb(255, 255, 255);
            border: 1px solid rgb(255, 255, 255);
            margin-left: auto;
            margin-right: auto;
            width: 90%;
            height: 100%;
            padding-top: 30px;
            text-align: center;
            font-size: 120%;
          }

          .loading_info {
            font-size: 80%;
            font-style: italic;
          }

          /* --- Top header --- */

          .app_header {
            height: 80px;
            max-width: 1440px;
            background-color: #eee;
            margin-left: auto;
            margin-right: auto;

            border-left: 1px solid whitesmoke;
            border-right: 1px solid whitesmoke;

            background-image: rgb(246, 248, 249);
            background-image: -moz-linear-gradient(top,
                rgb(246, 248, 249) 0%,
                rgb(215, 222, 227) 99%);
            background-image: -webkit-gradient(linear,
                left top,
                left bottom,
                color-stop(0%, rgb(246, 248, 249)),
                color-stop(99%, rgb(215, 222, 227)));
            background-image: -webkit-linear-gradient(top,
                rgb(246, 248, 249) 0%,
                rgb(215, 222, 227) 99%);
            background-image: -o-linear-gradient(top,
                rgb(246, 248, 249) 0%,
                rgb(215, 222, 227) 99%);
            background-image: -ms-linear-gradient(top,
                rgb(255, 255, 255) 0%,
                rgb(255, 255, 255) 99%);
            filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#f6f8f9', endColorstr='#d7dee3', GradientType=0);
            background-image: linear-gradient(top,
                rgb(255, 255, 255) 0%,
                rgb(255, 255, 255) 99%);
          }

          @media screen and (min-width: 1024px) {
            .app_header {
              width: 100%;
            }
          }

          a {
            color: blue !important;
          }

          .app_header a {
            color: #900;
          }

            margin: 10px;
            margin-left: 16px;
            float: left;
            width: 48px;
            height: 48px;
          }

          .app_header_search {
            float: right;
            padding: 10px;
          }

          .app_header_search_help {
            display: inline-block;
            background-color: #bbb;
            color: white;
            width: 14px;
            height: 14px;
            border-radius: 50%;
            text-align: center;
            font-weight: bold;
            position: relative;
            top: -1px;
            cursor: pointer;
          }

          .app_header_stats {
            padding: 10px;
            padding-top: 0px;
            font-style: italic;
          }

          /* --- Main areas --- */

          .content {
            max-width: 1440px;
            display: none;
            padding: 0px;
            margin-left: auto;
            margin-right: auto;
            background: white;
            border: none;
            border-left: 1px solid whitesmoke;
            border-right: 1px solid whitesmoke;
            border-bottom: 1px solid whitesmoke;
          }

          @media screen and (min-width: 1024px) {
            .content {
              border: 10px solid rgba(255, 255, 255, 0);
              width: 90%;

            }
          }

          .treeview {
            position: relative;
            height: 100%;
            width: 29%;
            float: left;
            overflow: auto;
            border-top: 1px solid whitesmoke;
          }

          .treeview_bold {
            font-weight: bold;
          }

          .list_container {
            position: relative;
            height: 100%;
            overflow: auto;
            border-top: 1px solid whitesmoke;
          }

          .list_files {
            overflow: auto;
            position: relative;
          }

          .search_indicator {
            position: absolute;
            left: 0px;
            right: 0px;
            top: 0px;
            bottom: 0px;
            background-color: white;
            opacity: 0.7;
            text-align: center;
            padding-top: 100px;
            font-size: 18px;
            display: none;
            z-index: 99;
          }

          /* --- Splitter --- */

          .vsplitbar {
            width: 4px;
            background: #d7dee3;
            border-right: 1px solid #bbb;
          }

          /* --- File Table --- */

          #files.tablesorter {
            font-family: arial;
            background-color: #cdcdcd;
            font-size: 8pt;
            line-height: 1.25em;
            width: 100%;
            text-align: left;
            border-spacing: 0px;
            border-bottom: 1px solid #ccc;
          }

          #files.tablesorter thead tr th,
          #files.tablesorter tfoot tr th {
            background: #ffefcc;
            border-left: 1px solid #ccc;
            border-right: 1px solid #ccc;
            padding: 4px;
            border-left: 0px;
          }

          #files.tablesorter thead tr .header {
            background-image: url(data:image/gif;base64,R0lGODlhFQAJAIAAACMtMP///yH5BAEAAAEALAAAAAAVAAkAAAIXjI+AywnaYnhUMoqt3gZXPmVg94yJVQAAOw==);
            background-repeat: no-repeat;
            background-position: center right;
            cursor: pointer;
            text-align: center;
          }

          #files.tablesorter tbody td {
            vertical-align: top;
            background-color: #fff;
            border-bottom: none;
            border-left: none;
            border-right: 1px solid #ccc;
            border-top: 1px solid #e0e0e0;
            padding: 3px 4px 3px 4px;
          }

          #files.tablesorter:not(.has-parent-folder) tbody tr:nth-child(even) td {
            background-color: #f8f8f8;
          }

          #files.tablesorter.has-parent-folder tbody tr:nth-child(odd) td {
            background-color: #f8f8f8;
          }

          #files.tablesorter tbody tr:hover td,
          #files.tablesorter tbody tr:nth-child(even):hover td {
            background-color: #e4f0f9;
          }

          #files.tablesorter thead tr .headerSortUp {
            background-image: url(data:image/gif;base64,R0lGODlhFQAEAIAAACMtMP///yH5BAEAAAEALAAAAAAVAAQAAAINjB+gC+jP2ptn0WskLQA7);
          }

          #files.tablesorter thead tr .headerSortDown {
            /*background-image: url(tree_tablesorter_desc.gif);*/
            background-image: url(data:image/gif;base64,R0lGODlhFQAEAIAAACMtMP///yH5BAEAAAEALAAAAAAVAAQAAAINjI8Bya2wnINUMopZAQA7);
          }

          #files.tablesorter thead tr .headerSortDown,
          #files.tablesorter thead tr .headerSortUp {
            background-color: #ffd283;
          }

          #files.tablesorter th:last-of-type,
          #files.tablesorter td:last-of-type {
            border-right: 0px;
          }

          span.file,
          span.file_folder {
            background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAOCAYAAAAbvf3sAAAAYUlEQVR4nGNkYGBgqKmp+c+AB7S0tDCiCNTU1PzHBdavX/8f2UAmfCbDgLGxMdwVRGlA1sRCSGFAQACcffbsWeJtgAE6afj+/TtRir9//z5o/UAKYGRgYGAoLi7Gm/iQAQC+qjWGF5ecJwAAAABJRU5ErkJggg==) no-repeat left center;
            padding-left: 16px;
            padding-bottom: 1px;
            padding-top: 1px;
          }

          span.file_folder {
            background: url(data:image/gif;base64,R0lGODlhEAAOALMIAOC6eJdaH61zLZ9oJMOHNP/Sg//inv///////wAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAAAgALAAAAAAQAA4AAAQ9EMlJq72XaIKnOOAhdIRhFgCwaRQRviE3lWZtB5Rg78bo8TafZFAoGo8DSuDILOAmAUHT+JwMrthsZ4uIAAA7) no-repeat left center;
          }

          span.file a,
          span.file_folder a {
            text-decoration: none;
            color: #333;
          }

          span.file a:hover,
          span.file_folder a:hover {
            text-decoration: underline;
            color: #900;
          }

          td.size {
            text-align: right;
            white-space: nowrap;
          }

          td.date {
            white-space: nowrap;
          }

          /* make room for [..] */
          #files.tablesorter.has-parent-folder th {
            border-bottom: 1px solid #ccc;
          }

          #files.tablesorter.has-parent-folder tbody tr:first-child td {
            border-top: 20px solid white;
          }

          #parent_folder {
            position: absolute;
            top: 24px;
            left: 4px;
          }

          #parent_folder_border {
            background-color: #e0e0e0;
            height: 1px;
            position: absolute;
            width: 100%;
            top: 42px;
          }

          /* --- Breadcrumb --- */

          .list_header {
            background: #fff;
            font-family: arial;
            font-size: 8pt;
            border: 0px;
            border-bottom: 1px solid #ccc;
            padding: 3px;
            padding-left: 6px;
          }

          .list_header span {
            background-color: white;
          }

          .list_header a {
            text-decoration: none;
            color: #333;
          }

          .list_header a:hover {
            text-decoration: underline;
            color: #900;
          }

          .path_divider {
            display: inline-block;
            margin-left: 3px;
            margin-right: 2px;
            margin-bottom: 1px;
            width: 0px;
            height: 0px;
            border-style: solid;
            border-width: 3px 0 3px 5px;
            border-color: transparent transparent transparent #222;
          }

          /* --- Listview footer --- */

          .list_footer {
            padding: 10px;
            border-top: 1px solid #ccc;
          }

          .list_footer_open_export {
            float: right;
          }

          .list_footer_open_export:hover {
            text-decoration: underline;
            color: #900;
            cursor: pointer;
          }

          /* --- CSV LightBox --- */

          .export_lightbox {
            z-index: 1000;
            background-color: rgba(0, 0, 0, 0.75);
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            text-align: center;
            font-size: 13px;
            display: none;
          }

          .export_content {
            text-align: left;
            background-color: white;
            padding: 20px;
            padding-top: 5px;
            width: calc(100% - 40px);
            max-width: 800px;
            height: 240px;
            margin-left: auto;
            margin-right: auto;
            position: relative;
          }

          .export_options {
            line-height: 2em;
          }

          .export_options input {
            position: relative;
            top: 2px;
            left: 2px;
          }

          .export_options label {
            margin-right: 0.5em;
            padding-left: 0.5em;
          }

          .export_text {
            width: 100%;
            height: calc(100% - 5.25em);
            /* two .export_options => 4em + save link*/
          }

          .export_close:link,
          .export_close:visited {
            float: right;
            text-decoration: none;
            color: black;
          }

          // prevent automatic search for short queries

              "<tr>" +
              "<td><span class='file'>" +
              file_tmp +
              "</span></td>" +
              "<td class='size' data-sort='" +
              sTmp[1] +
              "'>" +
              bytesToSize(sTmp[1]) +
              "</td>" +
              "<td class='date' data-sort='" +
              sTmp[2] +
              "'>" +
              timestamp +
              "</td>" +
              "</tr>\n";
            currentView.push({
              name: sTmp[0],
              path: currentViewPath,
              type: "file",
              size: sTmp[1],
              date: sTmp[2],
            });
          }

          table_html += "</tbody></table>\n";

          document.getElementById("list_files").innerHTML = table_html;
          addFolderClickEventHandlers();
          $("#files").tablesorter({
            sortInitialOrder: "desc",
            headers: {
              1: {
                sorter: "datasort",
              },
              2: {
                sorter: "datasort",
              },
            },
          });

          var sFiles = " files";
          if (countFiles === 1) sFiles = " file";
          var sDirs = " folders";
          if (countDirs === 1) sDirs = " folder";
          $("#list_footer_info_label").html(
            countDirs +
              sDirs +
              " (" +
              bytesToSize(subdirTotSizes) +
              "), " +
              countFiles +
              sFiles +
              " (" +
              bytesToSize(
                dirs[SelectedFolderID][dirs[SelectedFolderID].length - 2]
              ) +
              ")"
          );

          $("#treeview #" + SelectedFolderID).addClass("treeview_bold");

          return false;
        }

        /* --- Treeview --- */

        function PopulateTreeviewNode(node) {
          var subdirs = getSubdirs(node.data.key);
          if (subdirs != "") {
            var len = subdirs.length;
            for (var c = 0; c < len; c++) {
              var newNode = node.addChild({
                title: getDirName(subdirs[c]),
                key: subdirs[c],
                unselectable: true,
                isFolder: true,
                tooltip: bytesToSize(getDirTreeSize(subdirs[c])),
              });
              PopulateTreeviewNode(newNode);
            }
          }
        }

        $("#treeview").dynatree({
          clickFolderMode: 1,
          minExpandLevel: 2,
          fx: {
            height: "toggle",
            duration: 100,
          },
          onActivate: function (node) {
            ShowFolder(node.data.key);
          },
          onDblClick: function (node) {
            node.expand(!node.isExpanded());
          },
        });

        // init treeview items
        var rootNode = $("#treeview")
          .dynatree("getRoot")
          .addChild({
            title: getDirName(0).replace(/\//, "\\"),
            key: "0",
            isFolder: true,
            tooltip: bytesToSize(getDirTreeSize(0)),
          });
        rootNode.tree.enableUpdate(false);
        PopulateTreeviewNode(rootNode);
        rootNode.tree.enableUpdate(true);
        rootNode.activate();

        // browse directly to folder at startup
        if (originalHash !== "") {
          var folderId = getFolderIdFromPath(originalHash);
          if (folderId) {
            expandToFolder(folderId);
          } else {
            location.hash = "";
          }
        }

        /* --- Export LightBox --- */

        function populateExport() {
          var output_plain = "";
          var output_json = [];
          var output_csv = "";

          // get the settings
          var showFiles = $("#export_checkbox_files").prop("checked");
          var showDirs = $("#export_checkbox_dirs").prop("checked");
          var fullPath = $("#export_checkbox_path").prop("checked");

          var colPath = $("#export_checkbox_col_path").prop("checked");
          var colType = $("#export_checkbox_col_type").prop("checked");
          var colSize = $("#export_checkbox_col_size").prop("checked");
          var colDate = $("#export_checkbox_col_date").prop("checked");

          var type = $("#export_lightbox input[type='radio']:checked").val();

          // set csv header
          var csv_line = '"Name"';
          if (colPath) csv_line += ',"Path"';
          if (colType) csv_line += ',"Type"';
          if (colSize) csv_line += ',"Size"';
          if (colDate) csv_line += ',"Date"';
          output_csv = csv_line + "\n";

          // collect and format items
          for (var i = 0; i < currentView.length; i++) {
            var path = "";
            if (fullPath) path = currentView[i].path + "\\";

            var json_line = {
              name: path + currentView[i].name,
            };
            if (colPath) json_line.path = currentView[i].path;
            if (colType) json_line.type = currentView[i].type;
            if (colSize) json_line.size = currentView[i].size;
            if (colDate)
              json_line.date = timestampToIsoString(currentView[i].date);

            var csv_line = '"' + path + currentView[i].name + '"';
            if (colPath) csv_line += ',"' + currentView[i].path + '"';
            if (colType) csv_line += ',"' + currentView[i].type + '"';
            if (colSize) csv_line += ',"' + currentView[i].size + '"';
            if (colDate)
              csv_line +=
                ',"' + timestampToIsoString(currentView[i].date) + '"';

            if (showFiles && currentView[i].type == "file") {
              output_plain += path + currentView[i].name + "\n";
              output_json.push(json_line);
              output_csv += csv_line + "\n";
            }
            if (showDirs && currentView[i].type == "dir") {
              output_plain += path + currentView[i].name + "\n";
              output_json.push(json_line);
              output_csv += csv_line + "\n";
            }
          }

          // print items
          var output = "";
          if (type == "plain") {
            output = output_plain;
          } else if (type == "json") {
            output = JSON.stringify(output_json)
              .replace(/},/g, "},\n")
              .replace(/^\[/, "[\n")
              .replace(/\]$/, "\n]");
          } else if (type == "csv") {
            output = output_csv;
          }
          $("#export_text").text(output).focus().select();
        }

        $("#list_footer_open_export").click(function () {
          var windowHeight = $("body").height();
          $("#export_checkbox_files").prop("checked", true);
          $("input[id^=export_checkbox_col]").attr("disabled", true);
          $("#export_options_columns").css("opacity", "0.5");
          populateExport();

          $("#export_content").innerHeight(windowHeight - 80);
          $("#export_content").css("top", 40);
          $("#export_lightbox").fadeIn("fast", function () {
            $("#export_text").focus().select();
          });
        });

        $("#export_save").click(function () {
          var type = $("#export_lightbox input[type='radio']:checked").val();
          if (type == "plain") {
            downloadToFile(
              $("#export_text").text(),
              "snap2html_export.txt",
              "text/plain;encoding:utf-8"
            );
          } else if (type == "json") {
            downloadToFile(
              $("#export_text").text(),
              "snap2html_export.json",
              "application/json;encoding:utf-8"
            );
          } else if (type == "csv") {
            downloadToFile(
              $("#export_text").text(),
              "snap2html_export.csv",
              "text/csv;encoding:utf-8"
            );
          }
        });

        $("#export_close").click(function () {
          $("#export_lightbox").fadeOut("fast");
        });

        $("#export_content").click(function (event) {
          event.stopPropagation();
        });
        $("#export_lightbox").click(function () {
          $("#export_lightbox").fadeOut("fast");
        });
        $("#export_lightbox input[type=radio]").click(function () {
          var type = $("#export_lightbox input[type='radio']:checked").val();
          if (type !== "plain") {
            $("input[id^=export_checkbox_col]").removeAttr("disabled");
            $("#export_options_columns").css("opacity", 1);
          } else {
            $("input[id^=export_checkbox_col]").attr("disabled", true);
            $("#export_options_columns").css("opacity", 0.5);
          }
        });
        $(
          "#export_lightbox input[type=checkbox], #export_lightbox input[type=radio]"
        ).click(function () {
          populateExport();
        });

        document.addEventListener("keypress", function (keyEvent) {
          if (keyEvent.keyCode == 27) {
            // esc
            if ($("#csv_lightbox").length > 0) {
              $("#csv_lightbox").fadeOut("fast");
            }
          }
        });

        /* --- Helper Functions --- */

        function expandToFolder(id) {
          var tree = $("#treeview").dynatree("getTree");
          var node = tree.getNodeByKey(id.toString());
          if (node) {
            node.activate();
          }
        }

        function getFolderIdFromPath(path) {
          for (var c = 0; c < numDirs; c++) {
            if (dirs[c][0].split("*")[0] == path) {
              return c;
            }
          }
          return null;
        }

        function getDirName(id) {
          if (dirs.length <= id) return "";
          var tmp = dirs[id][0].split("*");
          var tmp2 = tmp[0].substring(tmp[0].lastIndexOf("/") + 1);
          if (tmp2 === "") return tmp[0];
          else return tmp2;
        }

        function getDirNameAndPath(id) {
          if (dirs.length <= id) return "";
          var tmp = dirs[id][0].split("*");
          return tmp[0];
        }

        function getSubdirs(id) {
          if (dirs.length <= id) return "";
          return dirs[id][dirs[id].length - 1].split("*");
        }

        function getPathToDir(id) {
          var parentId = parent_folders[id];
          var path = [];
          if (id != 0) {
            path.push(id);
          }
          while (parentId > 0) {
            path.push(parentId);
            parentId = parent_folders[parentId];
          }
          path.push(0);
          return path.reverse();
        }

        function getDirSize(id) {
          if (dirs.length <= id) return "0";
          return dirs[id][dirs[id].length - 2];
        }

        function getDirTreeSize(id) {
          if (dirs.length <= id) return "0";
          var totSize = getDirSize(id);
          var subdirs = getSubdirs(id);
          if (subdirs != "") {
            var len = subdirs.length;
            for (var c = 0; c < len; c++) {
              totSize += getDirTreeSize(subdirs[c]);
            }
          }
          return totSize;
        }

        function bytesToSize(bytes) {
          var kilobyte = 1024;
          var megabyte = kilobyte * 1024;
          var gigabyte = megabyte * 1024;
          var terabyte = gigabyte * 1024;

          if (bytes >= 0 && bytes < kilobyte) {
            return bytes + " bytes";
          } else if (bytes >= kilobyte && bytes < megabyte) {
            return (bytes / kilobyte).toFixed(0) + " KB";
          } else if (bytes >= megabyte && bytes < gigabyte) {
            return (bytes / megabyte).toFixed(1) + " MB";
          } else if (bytes >= gigabyte && bytes < terabyte) {
            return (bytes / gigabyte).toFixed(2) + " GB";
          } else if (bytes >= terabyte) {
            return (bytes / terabyte).toFixed(2) + " TB";
          } else {
            return bytes + " bytes";
          }
        }

        function timestampToDate(timestamp) {
          // Convert UNIX timestamp to local date
          // If you don't like the date format, try something else, such as toLocaleDateString() manually formatting the date here
          return new Date(timestamp * 1000).toLocaleString();
        }

        function timestampToIsoString(timestamp) {
          // Convert UNIX timestamp to ISO string (for use in export view)
          return new Date(timestamp * 1000).toISOString();
        }

        // debounce() from Underscore.js
        // Returns a function, that, as long as it continues to be invoked, will not
        // be triggered. The function will be called after it stops being called for
        // N milliseconds. If `immediate` is passed, trigger the function on the
        // leading edge, instead of the trailing.
        function debounce(func, wait, immediate) {
          var timeout;
          return function () {
            var context = this,
              args = arguments;
            var later = function () {
              timeout = null;
              if (!immediate) func.apply(context, args);
            };
            var callNow = immediate && !timeout;
            clearTimeout(timeout);
            timeout = setTimeout(later, wait);
            if (callNow) func.apply(context, args);
          };
        }

        // Save export to local file. Based on https://stackoverflow.com/a/29304414/1087811
        function downloadToFile(content, fileName, mimeType) {
          var a = document.createElement("a");
          mimeType = mimeType || "application/octet-stream";

          if (navigator.msSaveBlob) {
            // IE10
            navigator.msSaveBlob(
              new Blob([content], {
                type: mimeType,
              }),
              fileName
            );
          } else if (URL && "download" in a) {
            //html5 A[download]
            a.href = URL.createObjectURL(
              new Blob([content], {
                type: mimeType,
              })
            );
            a.setAttribute("download", fileName);
            document.body.appendChild(a);
            a.click();
            document.body.removeChild(a);
          } else {
            location.href =
              "data:application/octet-stream," + encodeURIComponent(content); // only this mime type is supported
          }
        }
      }); // end $(document).ready
    </script>
